import React from "react";
let uuid = "6c56e968-4b9c-c9d6-068a-109a03b13866";
const url = 'https://valorant-api.com/v1/';
let search ="maps";
let happened = false;

function Maps() {

    fullData();

    return <div id="maps">

    </div>

}

async function fullData() {
    if (!happened) {
        happened = true;
        const response = await fetch(url + search);
        const data = await response.json();
        let a = data.data.length / 3;
        let x = 0;
        let y = Math.round(a);

        for (let k = 0; k < Math.ceil(a); k++){
            x++;
            createMapRow(x);
           mapCreator();

        }
    }
}

function createMap(a, k) {
    let map = document.createElement("div");
    map.id = "map" + a;

    let mapTitle = document.createElement("h2");
    mapTitle.id = "map" + a + "Title";

    let mapImg = document.createElement("img");
    mapImg.id="map" + a + "Img";

    let mapSchema = document.createElement("img");
    mapSchema.id="map" + a + "schema";

    map.appendChild(mapTitle);
    map.appendChild(mapImg);
    map.appendChild(mapSchema);
    document.getElementById("mapRow" + k).appendChild(map);
}
function createMapRow(k){
    let mr = document.createElement("div");
    mr.id = "mapRow" + k;
    mr.className = "mRow";
    document.getElementById("maps").appendChild(mr);
}

function mapCreator() {
    for (let i = 0; i < y; i++){
        createMap(i, x);
        document.getElementById("map" + i + "Title").textContent = data.data[i].displayName;
        document.getElementById("map" + i + "Img").src= data.data[i].splash;
        document.getElementById("map" + i + "Img").width = 256;
        document.getElementById("map" + i + "Img").height = 144;
        document.getElementById("map" + i + "schema").width = 256;
        document.getElementById("map" + i + "schema").height = 256;
        document.getElementById("map" + i + "schema").src=data.data[i].displayIcon;
    }
}

export default Maps;
